import logo from "./logo.svg"
import "./App.css"

const App = () => {
  return (
    <div className="App">
      <h1> Hello World!</h1>
      <Header />
    </div>
  )
}

const Header = () => {
  return (
    <div>
      <a href="">Home</a>
      <a href="">News Feed</a>
      <a href="">Messages</a>
      <a href="">Profile</a>
    </div>
  )
}

export default App
